const LiveStats = () => {
  return (
    <div>
      <div class="card mt-3 view overlay">
        <div class="card-body">
          <div className="container row">
          <h5 class="card-title">Confirmed</h5>
          <h3 className="badge badge-danger ml-auto" style={{fontSize:"20px"}}>5245</h3>
          </div>
          <p class="card-text">
            Some quick example text to build on the panel title and make up the
            bulk of the panel's content
            Some quick example text to build on the panel title and make up the
            bulk of the panel's content.
          </p>
          <a class="card-link">Card link</a>
          <a class="card-link">Another link</a>
        </div>
        <div class="mask flex-center rgba-blue-slight"></div>
      </div>
    </div>
  );
};

export default LiveStats;
